import React from 'react'
import {EduList} from "../Helper/eduList"
import EduItem from "../Component/EduItem"

function Education() {
  return (
    <div className='edu'>
        <h1 className='title'>Education</h1>
        <div className='eduList'>{EduList.map((eduItem, key) => {
            return <div>{eduItem.year}</div>
        })}</div>
    </div>
  )
}

export default Education
